        const response = await axios.get('http://127.0.0.1:8000/product/')
        try {
            setProduct(response)
            console.log(response.data)
            console.log(product)
        } catch (error) {
            console.log('error' + error)

        }
    }
    useEffect(() => {
        fetchproducts();
        // eslint-disable-next-line
    }, [])
  return (
    <div className="App">
     <Header/>
     <Product id = {product.id} image = {product.image} title = {product.title} /> 
    </div>
  );
}

